import React from "react";

import SearchSuggestions from "./SearchSuggestions";

import MusicVideo from "../util/MusicVideo";

type SearchBarProps = {
  videos: MusicVideo[];
};

export default function SearchBar({ videos }: SearchBarProps) {
  return (
    <>
      <div>SearchBar</div>;
      <SearchSuggestions videos={videos} />
    </>
  );
}
